export default function lists (props) {
console.log(props.header);
console.log(props.cards);
return( 
  <section class="List">
    <header class="List-header">
              <h2>{props.header}</h2>
    </header>
      <div class="List-cards">
        {props.cards}
      </div>
      <button type="button" class="List-add-button">
            + Add Random Card
      </button>
  </section>
  );
}
